import React from 'react'
import {Typography, AppBar,CssBaseline ,Toolbar ,Container} from '@mui/material'
import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown';
import SearchOutlinedIcon from '@mui/icons-material/SearchOutlined';
import { makeStyles } from '@mui/styles';
import CurrentBooks from './CurrentBooks';
import FinishedBooks from './FinishedBooks';
import Footer from './Footer';
import Menu from './Menu'
import SwitchTab from './molecules/SwitchTab';
import logo from './atoms/images/logo.png';
import Image from './atoms/Image'
import User from './atoms/User'
import Icons from './atoms/Icons';
import Text from './atoms/Text';

const useStyles = makeStyles(theme => ({
  avatar: {
    position: 'absolute',
    left:'75%',
     },
  arrow:{
    color: 'black',
    position: 'absolute',
    left:'74.69%'
  },
  search:{color: 'black',
    position: 'absolute',
    left: '23.69%',
    right: '7.03%',
    top: '34.88%',
    bottom: '7.03%'},
  logo:{position: 'absolute',
    left: '17.36%',
    right: '74.02%',
    top: '34.88%',
    bottom: '34.88%'
  },
explore:{
    color: 'black',
    position: 'absolute',
    fontSize: '16px',
    fontStyle: 'normal',
    fontWeight: '500',
    lineHeight: '20px',
    letterSpacing: '0em',
    textAlign: 'left',
    left:'28.69%'
},
myLib:{
  color: 'black',
      position: 'absolute',
      left:'35.69%',
      fontSize: '16px',
      fontStyle: 'normal',
      fontWeight: '500',
      lineHeight: '20px',
      letterSpacing: '0em',
      textAlign: 'left'
}
})); 

function App(){
  const classes=useStyles()

  return (
    <>
   {/*  <Cards imag={one} name="Bring Your Human to Work" author="Erica Keswin" duration="13"/> */}
    <CssBaseline />
    <AppBar  style={{ background: '#FFFFFF'}} position='relative'>
      <Toolbar>
      <Image className={classes.logo} path={logo} />

      <Icons className={classes.search}>
      <SearchOutlinedIcon/>
      </Icons>

     <Text className={classes.explore} variant='body1' content='Explore'/>

      <KeyboardArrowDownIcon style={{ color: 'black',
      position: 'absolute',
      left:'31.69%',}}/>

      <Text className={classes.myLib} variant='body1' content='My Library'/>


      <User className={classes.avatar}  username="B" />

      <Icons className={classes.arrow}>
        <KeyboardArrowDownIcon />
      </Icons>

      </Toolbar>
    </AppBar>
    {/* <Menu /> */}
    <main>
        <Container maxWidth="lg">
        <Typography variant="h6" style={{
      fontSize: '36px',
      lineHeight: '45px',
      fontStyle: 'normal',
      marginLeft:'10%'}} align="left" color="black" gutterBottom>
          My Library
        </Typography>
        </Container>
    </main>

    <SwitchTab/>

    <Footer />
    </>
  );
}
export default App;
